  return (
    <div className="w-full bg-white pb-3 pl-4">
      <div>

      </div>
      <ul className="w-full flex items-center justify-end overflow-x-auto">
        <li className={`font-sans font-lg border border-zinc-800 bg-white text-white py-2 px-4 rounded-full mr-2 select-none cursor-pointer`} value="">All</li>
        <li className={`font-sans font-lg border border-zinc-800 bg-zinc-800 text-slate-800 py-2 px-4 rounded-full mr-2 select-none cursor-pointer`} value="">All</li>
      </ul>
    </div>
  );
}

